  }

  retrieveDailyScheduleDataFromDatabase = (courseNum) => {
    fetch(END_POINT_ROOT + `detailedSchedule?courseNum=${courseNum}`, {
      method: 'GET',
      headers: { 'Content-Type': 'application/json' },
    })
      .then(response => {
        return response.text();
      })
      .then(data => {
